import TableRow from "./TableRow";

export default function DisplayTable(props) {
  const fallBack = {
    year: "YEAR NUMBER",
    savingsEndOfYear: "TOTAL SAVINGS END OF YEAR",
    yearlyInterest: "INTEREST GAINED IN YEAR",
    totalInterest: "TOTAL INTEREST GAINED",
    investedCapital: "TOTAL INVESTED CAPITAL",
  };
  return (
    <table className="result">
      <thead>
        <tr>
          <th>Year</th>
          <th>Total Savings</th>
          <th>Interest (Year)</th>
          <th>Total Interest</th>
          <th>Invested Capital</th>
        </tr>
      </thead>

      {props.data.length == 0 ? (
        <TableRow yearInfo={fallBack} />
      ) : (
        props.data.map((info) => <TableRow yearInfo={info} />)
      )}
    </table>
  );
}
